In meinem heutigen VLOG sind wir in der Area47 und durchqueren nicht nur eine Schlucht, nein, wir fahren auch noch mit dummen Gegenständen Wasserski (zumindest versuchen wir es).

Noch bis Ende des Jahres könnt ihr bei den Allianz Creator Quests voten https://allianz.de/quests. Mit jedem Vote erhöht ihr eure Chance auf den Hauptgewinn! (Werbung)

Zu allen Teilnehmern:
@jan.schlappen 
@paulfrege 
@Aditotoro 
